import React from 'react';
import '../Profile/Profile.css';
import wallpaper from './img/wallpaper.jpg';
import UserComponent from "./User";

const ProfileComponent = () => {

    let oneUser = {
        avatarSrc : "./img/avatar.jpg",
        firstName : "Илья",
        secondName : "Муромец",
        birthday: "2 января",
        city: "Минск",
        education: "БГУ'11",
        site: ""
    };

    return (
        <div>
            <img src={wallpaper} className={'wallpaper'}/>
            <UserComponent avatarSrc={oneUser.avatarSrc} firstName={oneUser.firstName} secondName={oneUser.secondName} />
        </div>
    );
}

export default ProfileComponent;
